import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
    width: 100%;
    padding: 30px;

    display: flex;
    flex-direction: row;
    align-items: flex-start;
    justify-content: center;
`;

const MyApp = () => {
    return <Wrapper>ddd</Wrapper>
};

export default MyApp;
